function checkProduct() {
  var productCardHTML = '';
  var daiContainters = document.querySelectorAll('div[id^="dialogue_widget_"]');
  daiContainters.forEach(function (daiContainterInner, index) {
    var daiContainter = daiContainterInner.parentElement;
    //console.log(daiContainter);
    if (daiContainter.classList.contains('checked')) {
      return 0;
    }
    var daiCarousel = daiContainter.querySelector('.carousel');
    var sectionWrapperFull = daiContainter.closest('.section.section-full');
    if (sectionWrapperFull != null) {
      sectionWrapperFull.style.paddingLeft = 0;
      sectionWrapperFull.style.paddingRight = 0;
    }
    if (daiCarousel != null) {
      daiCarousel.style.display = 'none';
    } else {
      return 0;
    }
    var cardProductList = document.createElement('product-list');
    cardProductList.classList.add('product-list');
    cardProductList.classList.add('boost-pfs-filter-products');
    cardProductList.classList.add('boost-pfs-container-default-fullwidth');
    if (!daiContainter.querySelectorAll('product-list').length) {
      daiContainter.appendChild(cardProductList);
    } else {
      return;
    }
    var daiProductList = daiContainter.querySelector('product-list');
    daiProductList.style.display = 'none';
    if (document.querySelectorAll('.dai-slide').length) {
      var upsellLinks = [];
      var upsellProductSlide = document.querySelectorAll('.dai-slide');
      //console.log(upsellProductSlide.length);
      upsellProductSlide.forEach(function (slide, index) {
        var link = slide.querySelector('a').getAttribute('href').split('?')[0];
        upsellLinks.push(link);
      });
      upsellLinks = removeDuplicates(upsellLinks);
      //console.log(upsellLinks.length);
      var count = 0;
      upsellLinks.forEach(function (url, index) {
        var link = url + '/?view=card';
        var handle = url.split('/products/')[1];
        link = link.replace('globe-plants.myshopify.com', 'globeplants.com');
        fetch(link).then(function (res) {
          return res.text();
        }).then(function (html) {
          //productCardHTML += html;
          var cardElement = createElementFromHTML(html);
          if (cardElement == null) {
            return 0;
          }
          if (!daiProductList.querySelectorAll('[handle="' + handle + '"]').length) {
            daiProductList.appendChild(createElementFromHTML(html));
          }
          var id = cardElement.getAttribute('data-id');
          var quickBuyDrawer = document.querySelectorAll('quick-buy-drawer[id="quick-buy-' + id + '"]');
          quickBuyDrawer.forEach(function (drawer, index) {
            if (index > 0) drawer.remove();
          });
          count++;
          if (!daiProductList.classList.contains('slick-initialized')) {} else {}
          if (count == upsellLinks.length) {
            //console.log(count);
            daiProductList.style.display = 'block';
            daiContainter.style.display = 'block';
            daiContainter.classList.add('checked');
            $(daiProductList).slick({
              dots: false,
              arrows: true,
              infinite: true,
              speed: 300,
              slidesToShow: 4,
              slidesToScroll: 1,
              responsive: [{
                breakpoint: 1150,
                settings: {
                  slidesToShow: 3
                }
              }, {
                breakpoint: 1000,
                settings: {
                  slidesToShow: 2
                }
              }, {
                breakpoint: 700,
                settings: {
                  slidesToShow: 1
                }
              }]
            });
          }
        });
      });
    }
  });
}
